// src/Dashboard.js
import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { auth, db } from "../firebase";
import { collection, query, where, getDocs } from "firebase/firestore";
import "../styles/Dashboard.css";

const Dashboard = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  const [courses, setCourses] = useState([]);

  useEffect(() => {
    const currentUser = auth.currentUser;
    if (currentUser) {
      setUser({
        uid: currentUser.uid,
        name: currentUser.displayName,
        email: currentUser.email,
        photo: currentUser.photoURL,
      });
      // ดึงข้อมูลวิชาที่สอนจาก Firestore (collection "classroom" ที่มี owner ตรงกับ currentUser.uid)
      const fetchCourses = async () => {
        try {
          const q = query(
            collection(db, "classroom"),
            where("owner", "==", currentUser.uid)
          );
          const querySnapshot = await getDocs(q);
          const coursesData = [];
          querySnapshot.forEach((docSnap) => {
            coursesData.push({ cid: docSnap.id, ...docSnap.data() });
          });
          setCourses(coursesData);
        } catch (error) {
          console.error("Error fetching courses:", error);
        }
      };
      fetchCourses();
    }
  }, []);

  const handleLogout = () => {
    // ตัวอย่าง: ใช้ firebase.auth().signOut() (หรือ auth.signOut() ถ้าใช้ Firebase v9)
    auth.signOut();
    navigate("/");
  };

  const handleAddCourse = () => {
    navigate("/add-course");
  };

  const handleEditProfile = () => {
    navigate("/edit-profile");
  };

  const handleManageClassroom = (cid) => {
    navigate(`/manage/${cid}`);
  };

  return (
    <div className="dashboard">
      <header className="dashboard-header">
        {user && (
          <div className="user-info">
            <img src={user.photo} alt="User Photo" className="user-photo" />
            <div className="user-details">
              <h2>{user.name}</h2>
              <p>{user.email}</p>
            </div>
          </div>
        )}
        <div className="header-actions">
          <button onClick={handleAddCourse} className="button">
            เพิ่มวิชา
          </button>
          <button onClick={handleEditProfile} className="button">
            แก้ไขข้อมูลส่วนตัว
          </button>
          <button onClick={handleLogout} className="button">
            Logout
          </button>
        </div>
      </header>
      <main className="dashboard-content">
        <h2>วิชาที่สอน</h2>
        {courses.length > 0 ? (
          <ul className="course-list">
            {courses.map((course) => (
              <li key={course.cid} className="course-item">
                <img
                  src={course.info.photo}
                  alt={course.info.name}
                  className="course-photo"
                />
                <div className="course-info">
                  <h3>{course.info.name}</h3>
                  <p>รหัสวิชา: {course.info.code}</p>
                  <p>ห้องเรียน: {course.info.room}</p>
                </div>
                <button
                  onClick={() => handleManageClassroom(course.cid)}
                  className="button"
                >
                  จัดการห้องเรียน
                </button>
              </li>
            ))}
          </ul>
        ) : (
          <p>ยังไม่มีวิชาที่สอน</p>
        )}
      </main>
    </div>
  );
};

export default Dashboard;
